import React, { useEffect } from 'react';
import { Card } from 'react-bootstrap';
import { useSelector, useDispatch } from 'react-redux';
import { fetchUserPosts } from '../JS/Actions/user';

const Profile = () => {
  const dispatch = useDispatch();
  const user = useSelector((state) => state.userReducer.user);
  const userPosts = useSelector((state) => state.userReducer.userPosts);

  useEffect(() => {
    if (user) {
      dispatch(fetchUserPosts());
    }
  }, [dispatch, user]);

  return (
    <div className='profile'>
      <div>
        <Card style={{ width: '18rem' }}>
          <Card.Img
            variant='top'
            src='https://www.pngplay.com/wp-content/uploads/12/User-Avatar-Profile-Clip-Art-Transparent-PNG.png'
          />
          <Card.Body>
            <Card.Title>{user && user.name}</Card.Title>
            <Card.Text>{user && user.email}</Card.Text>
            <Card.Text>{user && user.phone}</Card.Text>
          </Card.Body>
        </Card>
      </div>

      <div>
        <h2>Your Posts</h2>
        {userPosts.map((post) => (
          <div key={post.id}>
            <h3>{post.name}</h3>
            {/* Display other post details */}
          </div>
        ))}
      </div>
    </div>
  );
};

export default Profile;
